import { Button, TextField } from "@mui/material";
import deliverLogo from "../assets/deliverLogo.png";
import deliverTitle from "../assets/deliverTitle.png";
import { useState } from "react";

const SignUp = () => {
  const [username, setUsername] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");
  const [address, setAddress] = useState("");
  const [id, setId] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = (event) => {
    event.preventDefault();
    console.log(username);
    console.log(phoneNumber);
    console.log(address);
    console.log(id);
  };

  const handleFindAddress = () => {
    console.log("주소찾기");
  };

  return (
    <div class="h-screen w-fit mx-auto flex items-center">
      <div class="flex justify-between w-fit gap-16">
        <div class="flex flex-col w-fit gap-8">
          <p class="text-blueLight text-5xl">회원가입</p>
          <p>
            계정을 가지고 있으신가요? <br />
            <a href="/signup" class="text-blueDark">
              로그인
            </a>
            을 진행해주세요
          </p>

          <div class="flex flex-col w-80 mb-8 gap-4">
            <FormLabel id="demo-row-radio-buttons-group-label">
              Gender
            </FormLabel>
            <RadioGroup
              row
              aria-labelledby="demo-row-radio-buttons-group-label"
              name="row-radio-buttons-group"
            >
              <FormControlLabel
                value="female"
                control={<Radio />}
                label="Female"
              />
              <FormControlLabel value="male" control={<Radio />} label="Male" />
              <FormControlLabel
                value="other"
                control={<Radio />}
                label="Other"
              />
              <FormControlLabel
                value="disabled"
                disabled
                control={<Radio />}
                label="other"
              />
            </RadioGroup>
            <TextField
              id="username"
              label="사용자 이름을 작성해주세요"
              variant="standard"
              onChange={(e) => setUsername(e.target.value)}
            />
            <TextField
              id="phoneNumber"
              label=" '-' 를 포함하여 휴대폰 번호를 입력해주세요."
              variant="standard"
              onChange={(e) => setPhoneNumber(e.target.value)}
            />
            <div class="flex w-80 items-center gap-4">
              <TextField
                id="address"
                label="주소를 작성해주세요"
                variant="standard"
                onChange={(e) => setAddress(e.target.value)}
                className="flex-1"
              />
              <Button variant="outlined" onClick={handleFindAddress}>
                주소찾기
              </Button>
            </div>
          </div>
          <Button
            variant="contained"
            type="submit"
            onClick={handleLogin}
            size="small"
          >
            Login
          </Button>
        </div>
      </div>
    </div>
  );
};
export default SignUp;
